package algorithm.leetcode;

import java.util.*;

public class Problem438 {

    static boolean sameHashMap(HashMap<Character, Integer> a, HashMap<Character, Integer> b) {
        if (a.size() != b.size())
            return false;
        Iterator<Map.Entry<Character, Integer>> it = a.entrySet().iterator();
        while (it.hasNext()) {
            Map.Entry<Character, Integer> entry = it.next();
            if (!b.containsKey(entry.getKey()))
                return false;
            if (!b.get(entry.getKey()).equals(entry.getValue()))
                return false;
        }
        return true;
    }

    public static List<Integer> findAnagrams(String s, String p) {
        List<Integer> ans = new ArrayList<>();
        if (s.length() < p.length())
            return ans;
        HashMap<Character, Integer> hashMap = new HashMap<>();
        HashMap<Character, Integer> targetHashMap = new HashMap<>();
        for (int i = 0; i < p.length(); i++) {
            targetHashMap.putIfAbsent(p.charAt(i), 0);
            targetHashMap.put(p.charAt(i), targetHashMap.get(p.charAt(i)) + 1);
        }
        for (int i = 0; i < p.length() - 1; i++) {
            hashMap.putIfAbsent(s.charAt(i), 0);
            hashMap.put(s.charAt(i), hashMap.get(s.charAt(i)) + 1);
        }

        for (int i = p.length() - 1; i < s.length(); i++) {
            hashMap.putIfAbsent(s.charAt(i), 0);
            hashMap.put(s.charAt(i), hashMap.get(s.charAt(i)) + 1);
            if (sameHashMap(hashMap, targetHashMap)) {
                ans.add(i - p.length() + 1);
            }
            hashMap.put(s.charAt(i - p.length() + 1), hashMap.get(s.charAt(i - p.length() + 1)) - 1);
            if (hashMap.get(s.charAt(i - p.length() + 1)) == 0)
                hashMap.remove(s.charAt(i - p.length() + 1));
        }
        return ans;
    }

    public static void main(String[] args) {
        String a = "";
        String b = "";

        findAnagrams(a, b);
    }

}

